import Vue from 'vue'
import VueRouter from 'vue-router'


Vue.use(VueRouter);

const routers =[
    {
        path:'./',
        name:'Home',
        component:() => import('../views/Home.vue')
    }
]


const router = new VueRouter({
    mode:'history',
    routers
})

export default router
